// SearchFilter.jsx
import React, { useState } from 'react';
import '../styles/SearchFilter.css';

const SearchFilter = ({ properties, setFilteredProperties }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [location, setLocation] = useState('');
  const [minPrice, setMinPrice] = useState('');
  const [maxPrice, setMaxPrice] = useState('');
  const [bedrooms, setBedrooms] = useState('');
  const [bathrooms, setBathrooms] = useState('');
  const [sortBy, setSortBy] = useState('default');

  // Get unique locations for the dropdown
  const uniqueLocations = [...new Set(properties.map(prop => prop.location))];

  const handleFilter = () => {
    let filtered = [...properties];

    // Filter by search term (property name)
    if (searchTerm) {
      filtered = filtered.filter(prop => 
        prop.title.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    // Filter by location
    if (location) {
      filtered = filtered.filter(prop => prop.location === location);
    }

    // Filter by price range
    if (minPrice) {
      filtered = filtered.filter(prop => parseFloat(prop.price) >= parseFloat(minPrice));
    }
    if (maxPrice) {
      filtered = filtered.filter(prop => parseFloat(prop.price) <= parseFloat(maxPrice));
    }

    // Filter by number of bedrooms
    if (bedrooms) {
      filtered = filtered.filter(prop => parseInt(prop.bedrooms) >= parseInt(bedrooms));
    }

    // Filter by number of bathrooms
    if (bathrooms) {
      filtered = filtered.filter(prop => parseInt(prop.bathrooms) >= parseInt(bathrooms));
    }

    // Sort filtered properties
    switch (sortBy) {
      case 'price-asc':
        filtered.sort((a, b) => parseFloat(a.price) - parseFloat(b.price));
        break;
      case 'price-desc':
        filtered.sort((a, b) => parseFloat(b.price) - parseFloat(a.price));
        break;
      case 'newest':
        filtered.sort((a, b) => new Date(b.created_at) - new Date(a.created_at));
        break;
      case 'oldest':
        filtered.sort((a, b) => new Date(a.created_at) - new Date(b.created_at));
        break;
      case 'most-liked':
        filtered.sort((a, b) => parseInt(b.likes || 0) - parseInt(a.likes || 0));
        break;
      case 'a-z':
        filtered.sort((a, b) => a.title.localeCompare(b.title));
        break;
      case 'z-a':
        filtered.sort((a, b) => b.title.localeCompare(a.title));
        break;
      default:
        // Keep original order or use default sorting
        break;
    }

    setFilteredProperties(filtered);
  };

  const clearFilters = () => {
    setSearchTerm('');
    setLocation('');
    setMinPrice('');
    setMaxPrice('');
    setBedrooms('');
    setBathrooms('');
    setSortBy('default');
    setFilteredProperties(properties);
  };

  return (
    <div className="search-filter">
      <div className="filter-container">
        <h3>Find Your Perfect Chalet</h3>
        
        <div className="filter-row">
          <div className="filter-group">
            <label>Search by Name</label>
            <input
              type="text"
              placeholder="Search chalets..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          
          <div className="filter-group">
            <label>Location</label>
            <select 
              value={location} 
              onChange={(e) => setLocation(e.target.value)}
            >
              <option value="">All Locations</option>
              {uniqueLocations.map((loc, index) => (
                <option key={index} value={loc}>{loc}</option>
              ))}
            </select>
          </div>
        </div>
        
        <div className="filter-row">
          <div className="filter-group">
            <label>Price Range (CHF)</label>
            <div className="price-inputs">
              <input
                type="number"
                placeholder="Min"
                value={minPrice}
                onChange={(e) => setMinPrice(e.target.value)}
              />
              <span className="price-separator">to</span>
              <input
                type="number"
                placeholder="Max"
                value={maxPrice}
                onChange={(e) => setMaxPrice(e.target.value)}
              />
            </div>
          </div>
          
          <div className="filter-group">
            <label>Min. Bedrooms</label>
            <select 
              value={bedrooms} 
              onChange={(e) => setBedrooms(e.target.value)}
            >
              <option value="">Any</option>
              <option value="1">1+</option>
              <option value="2">2+</option>
              <option value="3">3+</option>
              <option value="4">4+</option>
              <option value="5">5+</option>
            </select>
          </div>
          
          <div className="filter-group">
            <label>Min. Bathrooms</label>
            <select 
              value={bathrooms} 
              onChange={(e) => setBathrooms(e.target.value)}
            >
              <option value="">Any</option>
              <option value="1">1+</option>
              <option value="2">2+</option>
              <option value="3">3+</option>
              <option value="4">4+</option>
            </select>
          </div>
        </div>
        
        <div className="filter-row">
          <div className="filter-group">
            <label>Sort By</label>
            <select 
              value={sortBy} 
              onChange={(e) => setSortBy(e.target.value)}
            >
              <option value="default">Default</option>
              <option value="price-asc">Price: Low to High</option>
              <option value="price-desc">Price: High to Low</option>
              <option value="newest">Newest First</option>
              <option value="oldest">Oldest First</option>
              <option value="most-liked">Most Popular</option>
              <option value="a-z">Name: A to Z</option>
              <option value="z-a">Name: Z to A</option>
            </select>
          </div>
          
          <div className="filter-buttons">
            <button className="filter-button apply" onClick={handleFilter}>Apply Filters</button>
            <button className="filter-button clear" onClick={clearFilters}>Clear Filters</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SearchFilter;
